graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="prompt__key" align="left" balign="left">prompt</td><td port="prompt__value" align="left" balign="left">API: {{ config.url }}, Key: {{<BR/>config.key }}</td></tr><tr><td port="prompt__key_1" align="left" balign="left">prompt</td><td port="prompt__value_1" align="left" balign="left">Connect to {{ config.protocol<BR/>}}://{{ config.host }}:{{<BR/>config.port }}/{{ config.path<BR/>}}?key={{ config.apiKey<BR/>}}&amp;timeout={{ config.timeout<BR/>}}&amp;retry={{ config.retries }}</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces


}
